        if n < 0:
            return False
        x = 5 * (n * n) - 4
        y = 1 * (n * n) + 4
        return (x ** 0.5).is_integer() or (y ** 0.5).is_integer()
    unique_fibs = list(set([x for x in lst if is_fib(x)]))
    if len(unique_fibs) == 0:
        return 0
    product = 1
    for i in unique_fibs:
        product *= i
    return product

